import React, { useState, useEffect } from 'react';
import {
    AppBar, Toolbar, Typography, Button, Box, Drawer, IconButton, List, ListItem,
    ListItemText, ListItemIcon, CssBaseline, Grid, Paper, Avatar
} from '@mui/material';
import { Menu, People, Group, Event, AttachMoney, Logout } from '@mui/icons-material';
import { Link, useNavigate } from 'react-router-dom';
import Cookies from 'js-cookie';

const drawerWidth = 240;

const AdminDashboard = () => {
    const [mobileOpen, setMobileOpen] = useState(false);
    const [adminCount, setAdminCount] = useState(5);  // Mock Data
    const [playerCount, setPlayerCount] = useState(50);  // Mock Data
    const navigate = useNavigate();

    const handleDrawerToggle = () => {
        setMobileOpen(!mobileOpen);
    };

    const handleLogout = () => {
        Cookies.remove('token');
        Cookies.remove('admin');
        navigate('/login');
    };

    const drawer = (
        <Box sx={{ width: drawerWidth }}>
            <Toolbar />
            <List>
                <ListItem button component={Link} to="/dashboard">
                    <ListItemIcon><People /></ListItemIcon>
                    <ListItemText primary="Dashboard" />
                </ListItem>
                <ListItem button component={Link} to="/players">
                    <ListItemIcon><Group /></ListItemIcon>
                    <ListItemText primary="Players" />
                </ListItem>
                <ListItem button component={Link} to="/auctions">
                    <ListItemIcon><Event /></ListItemIcon>
                    <ListItemText primary="Auctions" />
                </ListItem>
                <ListItem button onClick={handleLogout}>
                    <ListItemIcon><Logout /></ListItemIcon>
                    <ListItemText primary="Logout" />
                </ListItem>
            </List>
        </Box>
    );

    return (
        <Box sx={{ display: 'flex' }}>
            <CssBaseline />
            
            {/* Navbar */}
            <AppBar position="fixed" sx={{ width: { sm: `calc(100% - ${drawerWidth}px)` }, ml: { sm: `${drawerWidth}px` } }}>
                <Toolbar>
                    <IconButton color="inherit" edge="start" onClick={handleDrawerToggle} sx={{ display: { sm: 'none' } }}>
                        <Menu />
                    </IconButton>
                    <Typography variant="h6" sx={{ flexGrow: 1 }}>Admin Cricket Auction</Typography>
                </Toolbar>
            </AppBar>

            {/* Sidebar */}
            <Box component="nav" sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}>
                <Drawer
                    variant="temporary"
                    open={mobileOpen}
                    onClose={handleDrawerToggle}
                    ModalProps={{ keepMounted: true }}
                    sx={{ display: { xs: 'block', sm: 'none' } }}
                >
                    {drawer}
                </Drawer>
                <Drawer variant="permanent" sx={{ display: { xs: 'none', sm: 'block' }, width: drawerWidth }}>
                    {drawer}
                </Drawer>
            </Box>

            {/* Main Content */}
            <Box component="main" sx={{ flexGrow: 1, p: 3, width: { sm: `calc(100% - ${drawerWidth}px)` } }}>
                <Toolbar />
                <Grid container spacing={3}>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'info.main', mr: 2 }}>
                                <People />
                            </Avatar>
                            <Box>
                                <Typography variant="h6">Total Admins</Typography>
                                <Typography>{adminCount}</Typography>
                            </Box>
                        </Paper>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'primary.main', mr: 2 }}>
                                <Group />
                            </Avatar>
                            <Box>
                                <Typography variant="h6">Total Players</Typography>
                                <Typography>{playerCount}</Typography>
                            </Box>
                        </Paper>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'success.main', mr: 2 }}>
                                <Event />
                            </Avatar>
                            <Box>
                                <Typography variant="h6">Active Auctions</Typography>
                                <Typography>1</Typography>
                            </Box>
                        </Paper>
                    </Grid>
                    <Grid item xs={12} sm={6} md={3}>
                        <Paper sx={{ p: 2, display: 'flex', alignItems: 'center' }}>
                            <Avatar sx={{ bgcolor: 'secondary.main', mr: 2 }}>
                                <AttachMoney />
                            </Avatar>
                            <Box>
                                <Typography variant="h6">Total Budget</Typography>
                                <Typography>â‚¹100Cr</Typography>
                            </Box>
                        </Paper>
                    </Grid>
                </Grid>
            </Box>
        </Box>
    );
};

export default AdminDashboard;
